import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getUsers } from "../redux/actions/usersAction";

const checkUsers = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    try {
      dispatch(getUsers());
    } catch (e) {
      console.log(e);
    }
  }, [dispatch]);
  
};

export default checkUsers;
